import React, {
  Component
} from 'react';
import {
  Route,
  BrowserRouter
} from 'react-router-dom';
import MainMenu from './MainMenu';
import Schedule from './Schedule';
import Staff from './Staff';

class App extends Component {
  renderStaff = () => {
    return <Staff / > ;
  };
  renderSchedule = () => {
    return <Schedule / > ;
  };
  render = () => {
    return ( <
      BrowserRouter >
      <
      div className = "global-container" >
      <
      MainMenu / >
      <
      Route exact = {
        true
      }
      path = "/"
      render = {
        this.renderSchedule
      } > < /Route> <
      Route exact = {
        true
      }
      path = "/schedule"
      render = {
        this.renderSchedule
      } > < /Route> <
      Route exact = {
        true
      }
      path = "/staff"
      render = {
        this.renderStaff
      } > < /Route> <
      /div> <
      /BrowserRouter>
    );
  };
}

export default App;
